import React from 'react';
import AboutMe from '../AboutMe/AboutMe';
import Toggle from '../Toggle/Toggle.jsx';
import './Navbar.css';
import Nav from 'react-bootstrap/Nav';
import { Link, animateScroll as scroll } from "react-scroll";

const Navbar = () => {
  return (
    <Nav navbarScroll>
          <div className='n-wrapper'>
      <div className='n-left'>
        <div className='n-name'>React-cv</div>
        <Toggle />
      </div>
      <div className='n-right'>
        <div className='n-list'>
          <ul style={{ listStyleType: 'none' }}>
            <Link to="#home" ><li><Link></Link> Home</li></Link>
            <Link to="#aboutme" ><li onClick={window.scrollTo(<AboutMe/>)}>About Me</li></Link>
            <Link to="#experience" ><li>Experience</li></Link>
          </ul>
        </div>
        <NavLink to="contact" ><button className='button n-button'>Contact Me</button></NavLink>
      </div>
    </div>
    </Nav>
  );
};

export default Navbar;
